import React, { Fragment } from "react";
import { Form, Input, Header } from "semantic-ui-react";
import "./App.css";

function App() {
  return (
    <Fragment>
      <Header></Header>

      <Form className="App">
        <Form.Field>
          <Input placeholder="Enter the task " fluid />
        </Form.Field>
      </Form>
    </Fragment>

    // <div>something</div>
  );
}

export default App;
